								<th>Activites</th>
							</tr>
						</thead>
						<tbody>
							{/* {users.map((user) => (
								<tr key={user._id}>
									<td>1</td>
									<td>0{user.phone}</td>
									<td>{user.firstName}</td>
									<td>{user.lastName}</td>
									<td>{user.points}</td>
									<td>
										<Link to={'/user/' + user._id}>View user</Link>
									</td>
								</tr>
							))} */}
						</tbody>
					</table>
				</div>
			)}
		</div>
	);
}

export default AdminUserDetail;
